import { connect } from 'react-redux';
import ComeBack from '../components';
import { test_action } from '../actions'
const mapStateToProps=(state)=>{console.log("state is ",state); return {Messages : state.mainReducer}; }
const mapDispatchToProps = (dispatch) => ({
  onClick: () => dispatch(test_action())
})
export default connect(mapDispatchToProps,mapStateToProps)(ComeBack);
